import {gql} from "@apollo/client"

export const GetDish = gql`
query ($slug: ID!) {
  gerecht(id: $slug, idType: SLUG) {
    gerechtmeta {
      title
      origin
      description
      profilePicture {
        sourceUrl
        altText
      }
    }
  }
}
`
